$(document).ready(function() {
    function addToDataLayer() {
        var event = this.getAttribute("data-an-event"),
            values = this.getAttribute("data-an-values");
        event = { event: event };
        values = values.replaceAll("'", '"');
        values = values.replaceAll(",}", "}");
        values = JSON.parse(values);
        const obj = $.extend(event, values);
        var dataLayer = window.dataLayer || [];
        dataLayer.push(obj);
        window.dataLayer = dataLayer;
    }
    if (document.querySelector("[data-an-event]")) {
        const elements = document.querySelectorAll("[data-an-event]");
        elements.forEach(function(el) {
            el.addEventListener("click", addToDataLayer);
        });
    }

    function trackPhoneNumbers() {
        var phoneNumber = this.getAttribute("href").split("tel:").pop(),
            phoneNumber = phoneNumber.split(" ").pop();
        var obj = {
            event: "phoneNumberClicked",
            sgsPhoneNumberPageLocation: "In-Page Content",
            sgsPhoneNumber: phoneNumber,
        };
        var dataLayer = window.dataLayer || [];
        dataLayer.push(obj);
        window.dataLayer = dataLayer;
    }
    if (document.querySelector('.page__content a[href*="tel"]')) {
        const phoneNumbers = document.querySelectorAll(
                '.page__content [href*="tel"]'
            ),
            phoneNumberClicked = document.querySelectorAll(
                '[data-an-event*="phoneNumberClicked"]'
            );
        phoneNumbers.forEach(function(el) {
            el.addEventListener("click", trackPhoneNumbers);
        });
    }

    function trackPdfClicks() {
        var pdfDocument = this.getAttribute("href").split("/").pop();
        var obj = {
            event: "documentDownload",
            documentPageLocation: "In-Page Content",
            documentName: pdfDocument,
        };
        var dataLayer = window.dataLayer || [];
        dataLayer.push(obj);
        window.dataLayer = dataLayer;
    }
    if (
        document.querySelector(
            '.page__content a[href*="pdf"]:not([data-an-event])'
        ) ||
        document.querySelector('.body-copy a[href*="pdf"]:not([data-an-event])')
    ) {
        console.log("yes we have it");
        const pdfDocuments = document.querySelectorAll(
            '.page__content [href*="pdf"]:not([data-an-event]), .body-copy [href*="pdf"]:not([data-an-event])'
        );
        pdfDocuments.forEach(function(el) {
            el.addEventListener("click", trackPdfClicks);
        });
    }

    function trackSearchResultsNumber() {
        var searchResultsNumber = $(".total-search-results").html();
        var obj = {
            event: "searchResultsAvailable",
            searchResults: searchResultsNumber,
        };
        var dataLayer = window.dataLayer || [];
        dataLayer.push(obj);
        window.dataLayer = dataLayer;
    }
    if (document.querySelector(".total-search-results")) {
        trackSearchResultsNumber();
    }
});
var dropdowns = {
    all: $(
        ".dropdown, #main-search, #main-nav, #main-nav-campaign, #share-toolbar, .skipper, #quick-contact"
    ),
    allWrappers: $(".dropdown-wrapper"),
    allTogglers: $(".dropdown-toggler, #main-nav-toggler, #search-toggler"),
    closeAll: function() {
        dropdowns.all.removeClass("visible");
        dropdowns.allWrappers.removeClass("active");
        dropdowns.allTogglers.removeClass("active");
    },
    init: function() {
        $(document).on(
            "click",
            ".dropdown-toggler, #main-nav-toggler, #search-toggler",
            function(event) {
                event.stopPropagation();
                var thisToggler = $(this);
                var thisTogglerHash = this.hash.substr(1);
                var hasSkipper = true;
                if (
                    $("#websites-nav").length > 0 &&
                    thisToggler.hasClass("dropdown-toggler") &&
                    thisToggler.parent().hasClass("skipper")
                ) {
                    thisToggler = $("#websites-nav .dropdown-toggler");
                    hasSkipper = true;
                }
                switch (thisTogglerHash) {
                    case "main-nav":
                    case "main-nav-campaign":
                    case "nav-main-dropdown-2016":
                    case "main-search":
                        var thisDropdown = $("#" + thisTogglerHash);
                        var thisWrapper = $("temp");
                        break;
                    default:
                        var thisDropdown = $(
                            ".dropdown",
                            thisToggler.closest(".dropdown-wrapper")
                        );
                        var thisWrapper = thisToggler.closest(".dropdown-wrapper");
                }
                var otherDropdowns = dropdowns.all.not(thisDropdown);
                var otherWrappers = dropdowns.allWrappers.not(thisWrapper);
                var otherTogglers = dropdowns.allTogglers.not(thisToggler);
                otherDropdowns.removeClass("visible");
                otherWrappers.removeClass("active");
                otherTogglers.removeClass("active");
                if (
                    thisDropdown.hasClass("visible") ||
                    thisToggler.hasClass("active")
                ) {
                    thisDropdown.removeClass("visible");
                    thisWrapper.removeClass("active");
                    thisToggler.removeClass("active");
                    if (hasSkipper) {
                        $(this).removeClass("active");
                    }
                } else {
                    thisDropdown.addClass("visible");
                    thisWrapper.addClass("active");
                    thisToggler.addClass("active");
                    if (hasSkipper) {
                        $(this).addClass("active");
                    }
                }
                return false;
            }
        );
        $(document).on("click", function(event) {
            if (
                $(event.target)
                .closest(
                    ".dropdown, #main-search, #main-nav, #main-nav-campaign, #share-toolbar, #quick-contact"
                )
                .get(0) === undefined
            ) {
                dropdowns.closeAll();
            }
        });
        $(document).on("keyup", function(event) {
            if (event.keyCode === 27) {
                dropdowns.closeAll();
            }
        });
        $(document).on("click", ".dropdown-close", function() {
            dropdowns.closeAll();
            return false;
        });
        if (document.getElementById("related-contacts")) {
            $("#quick-contact-anchor").removeClass("fullhide");
            $("#quick-contact-toggler").addClass("fullhide");
        }
    },
};
