var textarea = {
    elements: $("textarea[max]"),
    limitChars: function(textarea) {
        var text = textarea.val();
        var limit = textarea.attr("max");
        var textlength = text.length;
        var textareaParent = textarea.closest(".field");
        var whereToDisplayParent = textareaParent.children(".small-note").first();
        var whereToDisplay = $("strong", whereToDisplayParent);
        var remaining = limit - textlength;
        if (!(textlength < limit)) {
            textarea.val(text.substr(0, limit));
            whereToDisplay.text("0");
            whereToDisplayParent
                .removeClass("characters-ok")
                .addClass("characters-error");
        } else {
            whereToDisplay.text(remaining);
            whereToDisplayParent
                .removeClass("characters-error")
                .addClass("characters-ok");
        }
    },
    init: function() {
        $(document).on("change keyup", "textarea[max]", function() {
            textarea.limitChars($(this));
        });
        textarea.elements.each(function() {
            textarea.limitChars($(this));
        });
    },
};
