var sgsDev = {
    init: function() {
        $("#filter-by-download-topic-press-room-table").change(function() {
            filterPressRoomTable();
        });
        $("#filter-by-download-type-press-room-table").change(function() {
            filterPressRoomTable();
        });
        $("#filter-by-language-press-room-table").change(function() {
            filterPressRoomTable();
        });
        $("#filter-by-date-press-room-table").change(function() {
            filterPressRoomTable();
        });
        $("#search-query-press-room-table").on("click", function() {
            filterPressRoomTable();
        });

        function filterPressRoomTable() {
            var varTopic = $(
                "#filter-by-download-topic-press-room-table > option:selected"
            ).val();
            var varType = $(
                "#filter-by-download-type-press-room-table > option:selected"
            ).val();
            var varLanguage = $(
                "#filter-by-language-press-room-table > option:selected"
            ).val();
            var varDate = $(
                "#filter-by-date-press-room-table > option:selected"
            ).val();
            var keyword = $("#search-filter-press-room-table").val();
            var url = [
                location.protocol,
                "//",
                location.host,
                location.pathname,
            ].join("");
            var redirectURL =
                url +
                "?tpc=" +
                varTopic +
                "&typ=" +
                varType +
                "&lng=" +
                varLanguage +
                "&dat=" +
                varDate +
                "&kwrd=" +
                encodeURIComponent(keyword);
            window.location.href = redirectURL;
        }
    },
    getQueryStrings: function() {
        var assoc = {};
        var decode = function(s) {
            return decodeURIComponent(s.replace(/\+/g, " "));
        };
        var queryString = location.search.substring(1);
        var keyValues = queryString.split("&");
        var iCtr = 0;
        for (var i in keyValues) {
            var key = keyValues[i].split("=");
            if (key.length > 1) {
                assoc[decode(key[0])] = decode(key[1]);
                iCtr++;
            }
        }
        if (iCtr <= 0) return "";
        else return assoc;
    },
};
