var careersKeyNumbers = {
    noOfDecimals: 1,
    transitionDuration: 750,
    queue: [],
    hasStarted: false,
    start: function() {
        $(".animation-ready").each(function(i, el) {
            var el = $(el);
            if (el.visible(true) && !el.hasClass("animation-ready-queue")) {
                el.addClass("animation-ready-queue");
                careersKeyNumbers.queueAdd(el);
            }
        });
    },
    queueAdd: function(el) {
        if (el.has(".number-countable").length > 0) {
            var nc = $(el).find(".number-countable");
            var numericValue = $(nc).text().replace(",", "");
            $(nc).data("countValue", numericValue);
            $(nc).data(
                "isDecimal",
                parseInt(numericValue) == parseFloat(numericValue) ? false : true
            );
            $(nc).text(0);
            careersKeyNumbers.queue.push(nc);
        } else {
            careersKeyNumbers.queue.push(el);
        }
        if (careersKeyNumbers.hasStarted === false) {
            careersKeyNumbers.queueNext();
        }
    },
    queueNext: function() {
        if (careersKeyNumbers.queue.length > 0) {
            careersKeyNumbers.hasStarted = true;
            careersKeyNumbers.countUp(careersKeyNumbers.queue.shift());
        } else {
            careersKeyNumbers.hasStarted = false;
        }
    },
    countUp: function(el) {
        $(el)
            .parents(".animation-ready-queue")
            .andSelf()
            .removeClass("animation-ready")
            .addClass("activate-animation");
        if ($(el).is(".number-countable")) {
            $(el)
                .prop("counter", 0)
                .animate({ counter: $(el).data("countValue") }, {
                    duration: careersKeyNumbers.transitionDuration,
                    easing: "swing",
                    step: function(now) {
                        if ($(el).data("isDecimal")) {
                            $(this).text(now.numberFormat(careersKeyNumbers.noOfDecimals));
                        } else {
                            $(this).text(now.numberFormat(0));
                        }
                    },
                    done: function() {
                        careersKeyNumbers.queueNext();
                    },
                });
        } else {
            setTimeout(function() {
                careersKeyNumbers.queueNext();
            }, careersKeyNumbers.transitionDuration);
        }
    },
    init: function() {
        if ($(".list-careers-key-numbers").length > 0) {
            $(".list-careers-key-numbers li").addClass("animation-ready");
            careersKeyNumbers.start();
            $(window).scroll(function() {
                careersKeyNumbers.start();
            });
        }
    },
};
