            function createParametersList(parameterName, parameterItems) {
                if (parameterItems != "") {
                    var url = parameterName + "=";
                    $.each(parameterItems, function(i, item) {
                        if (i > 0) {
                            url += ";" + encodeURIComponent(item);
                        } else {
                            url += encodeURIComponent(item);
                        }
                    });
                    return url;
                } else {
                    return "";
                }
            }
            window.history.pushState({ path: url }, "", url);
