var safeguardsFilters = {
    init: function() {
        if ($("#newsletter-safeguards-results").length <= 0) return;
        safeguardsFilters.toggleLevel2Check(
            ".safeguards-filter-level-2 .input-check"
        );
        $(".input-check").on("change", function() {
            if ($(this).parent().hasClass("safeguards-filter-level-2")) {
                safeguardsFilters.toggleLevel2Check(this);
            } else if ($(this).parent().hasClass("safeguards-filter-level-1")) {
                safeguardsFilters.toggleLevel1Check(this);
            }
        });
    },
    toggleLevel1Check: function(level1Elem) {
        $(level1Elem).each(function() {
            var l1 = $(this).parent();
            if (l1.siblings(".list-checkbox").length <= 0) return;
            if ($(this).is(":checked")) {
                l1.siblings(".list-checkbox")
                    .find(".input-check")
                    .prop("checked", true);
            } else {
                l1.siblings(".list-checkbox")
                    .find(".input-check")
                    .prop("checked", false);
            }
        });
    },
    toggleLevel2Check: function(level2Elem) {
        $(level2Elem).each(function() {
            if (!$(this).is(":checked")) {
                $(this)
                    .closest(".list-checkbox")
                    .siblings(".safeguards-filter-level-1")
                    .find(".input-check")
                    .prop("checked", false);
            } else {
                var checked =
                    $(this).closest(".list-checkbox").find(".input-check:not(:checked)")
                    .length <= 0;
                $(this)
                    .closest(".list-checkbox")
                    .siblings(".safeguards-filter-level-1")
                    .find(".input-check")
                    .prop("checked", checked);
            }
        });
    },
};
$.fn.isInViewport = function() {
    var elementTop = $(this).offset().top;
    var elementBottom = elementTop + $(this).outerHeight();
    var viewportTop = $(window).scrollTop();
    var viewportBottom = viewportTop + $(window).height();
    return elementBottom > viewportTop && elementTop < viewportBottom;
};
